CREATE PROCEDURE dbo.proc_transform_167
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_167
    SET payload = LEFT(payload, 1000) + N'|V4-167|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_167;
END
